class Solution(object):
    def maximumSafenessFactor(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """
        # pre-process
        M = len(grid)
        N = len(grid[0])

        thieves = list()
        for x in range(M):
            for y in range(N):
                if grid[x][y] == 1:
                    thieves.append((x, y, 0))

        # bfs
        DIRECTIONS = ((-1, 0), (1, 0), (0, -1), (0, 1))
        from collections import deque
        bfs = deque()
        safenesses = [[float("inf")] * N for _ in range(M)]
        for thief in thieves:
            bfs.append(thief)
            safenesses[thief[0]][thief[1]] = 0


        while bfs:
            x, y, safeness = bfs.popleft()
            for dx, dy in DIRECTIONS:
                nx, ny = x + dx, y + dy
                if 0 <= nx < M and 0 <= ny < N:
                    if safenesses[nx][ny] > safeness + 1:
                        safenesses[nx][ny] = safeness + 1
                        bfs.append((nx, ny, safeness + 1))
        #print(safenesses)

        # process
        def canPass(target):
            if safenesses[0][0] < target or safenesses[M - 1][N - 1] < target:
                return False
            bfs = deque()
            bfs.append((0, 0))
            visited = [[False] * N for _ in range(M)]
            visited[0][0] = True

            while bfs:
                x, y = bfs.popleft()
                if x == M - 1 and y == N - 1:
                    return True
                for dx, dy in DIRECTIONS:
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < M and 0 <= ny < N:
                        if not visited[nx][ny] and safenesses[nx][ny] >= target:
                            visited[nx][ny] = True
                            bfs.append((nx, ny))
            return False

        # binary search
        left = 0
        right = M + N

        while left + 1 < right:
            middle = (left + right) // 2
            if canPass(middle):
                left = middle
            else:
                right = middle - 1

        if canPass(right):
            return right
        else:
            return left


